#include <bits/stdc++.h>
using namespace std;
#define faster() ios_base::sync_with_stdio(false);cin.tie();cout.tie();
#define matrix vector <vector<long long>>
#define MOD 1000000007
#define el "\n"
const long long big = 1e6;

vector <bool> Primes(1e6+5,true);
vector <long long> PrimeNumbs;

void SieveOfEratosthenes() {
    Primes[0] = Primes[1] = false;
    for (int i = 2 ; i * i <= 1e6 ; i++)
    {
        if ( Primes[i] == true )
        {
            for (int j = i * i ; j <= 1e6 ; j += i)
            {
                Primes[j] = false;
            }
        }
    }
	for (int i = 2 ; i <= 1e6 ; i++)
	{
		if ( Primes[i] == true )
		{
			PrimeNumbs.push_back(i);
		}
	}
}

int main() {
	faster();
	int t;
	cin >> t;
	SieveOfEratosthenes();
	while ( t-- )
	{
		int n;
		cin >> n;
		cout << 1 << " ";
		for (int i = 2 ; i <= n ; i++)
		{
			if ( i % 2 == 0 )
			{
				cout << 2 << " ";
			}
			else if ( Primes[i] == true )
			{
				cout << i << " ";
			}
			else
			{
				for (int j = 0 ; j < PrimeNumbs.size() ; j++)
				{
					if ( i % PrimeNumbs[j] == 0 )
					{
						cout << PrimeNumbs[j] << " ";
						break;
					}
				}
			}
		}
		if ( t != 0 )
		{
			cout << endl;
		}
	}
}

